import React from "react";
import Kamkala from "./Kamkala/Kamkala";
import Omcreation from "./Omcreation/Omcreation";
import Bollywood from "./Bollywood/Bollywood";
import Celebrity from "./Celebrity/Celebrity";
import Cabinate from "./Cabinate/Cabinate";
import Freedom from "./Freedom/Freedom";
import Galaxy from "./Galaxy/Galaxy";
function Gallery() {
  return (
    <>
      <Kamkala />
      <Omcreation />
      <Bollywood />
      <Celebrity />
      <Cabinate />
      <Freedom />
      <Galaxy/>
      <Art/>
    </>
  );
}

export default Gallery;
